import React from 'react';
import { View, TextInput, ScrollView, Text, ImageBackground, TouchableOpacity, Image } from 'react-native';
import styles from './style';

import She from '../../assets/she.png';



function Perfil({navigation}) {
   
  return (
    <ScrollView style={styles.fundoContainer}>   
    
      <View  style={styles.caixaPerfil}>
        <Text style={styles.titulo}>Recuperar Senha</Text>
      <View >
        <Text>Problemas para entrar?</Text>
        <Text>Digite a resposta da palavra secreta!</Text>
        <Text>Lembre-se: Primeira letra maiúscula e o restante minúscula</Text>
        
        
      <Text style={styles.corTexto}>Email : </Text>
        <TextInput style={styles.input}>
                
        </TextInput>

        <Text>DICA: Desenho Preferido</Text>
        <TextInput style={styles.input} secureTextEntry={true}>

        </TextInput>
        
          
      </View>   
      </View>

      
        
      

        


      
    </ScrollView>
  )
  
}

export default Perfil;
